import React from 'react';
import SideBar from './components/sidebar';
import Navbar from './components/Navbar/index';
import Home from './components/Home/index';


import './App.css';

export default function App() {
  return (
    <div id="App">
      <Navbar />
      <SideBar />
      <div id="page-wrap">
        <Home />
      </div>
    </div>
  );
}
